import { useEffect, useMemo, useState } from 'react'
import { registrationsList, bookingsList, toolsList, feedbackList, usersList, sessionsSummary, sessionsList } from '../../services/api'
import { Link } from 'react-router-dom'
import { IconDashboard, IconList, IconTools, IconFeedback, IconUsers, IconSearch, IconRefresh } from '../../components/Icons'
import Breadcrumbs from '../../components/Breadcrumbs'

function TabBar({ tab, setTab }) {
  const tabs = [
    { key: 'Dashboard', icon: <IconDashboard />, label: 'Dashboard' },
    { key: 'Registrations', icon: <IconList />, label: 'Registrations' },
    { key: 'Bookings', icon: <IconList />, label: 'Bookings' },
    { key: 'Tools', icon: <IconTools />, label: 'Tools' },
    { key: 'Feedback', icon: <IconFeedback />, label: 'Feedback' },
    { key: 'Users', icon: <IconUsers />, label: 'Users' },
  ]
  return (
    <div className="tabs">
      {tabs.map(t => (
        <button key={t.key} className={`tab ${tab===t.key?'active':''}`} onClick={()=>setTab(t.key)}>
          <span style={{ display:'inline-flex', alignItems:'center', gap:6 }}>
            {t.icon}<span>{t.label}</span>
          </span>
        </button>
      ))}
    </div>
  )
}

export default function AdminDashboard() {
  const [tab,setTab] = useState('Dashboard')
  const [data,setData] = useState([])
  const [err,setErr] = useState('')
  const [search,setSearch] = useState('')
  const [page,setPage] = useState(1)
  const pageSize = 10
  const [metrics,setMetrics] = useState({ registrations:0, bookings:0, tools:0, feedback:0, users:0, sessions:{ total:0, today:0, active:0, uniqueUsers:0 } })
  const [recentUsers,setRecentUsers] = useState([])
  const [recentSessions,setRecentSessions] = useState([])

  useEffect(() => {
    (async () => {
      try {
        setErr('')
        if (tab==='Dashboard') {
          // Load counts for cards and recents
          const [r,b,t,f,u,summ,slist] = await Promise.all([
            registrationsList().catch(()=>({ registrations:[] })),
            bookingsList().catch(()=>({ bookings:[] })),
            toolsList().catch(()=>({ tools:[] })),
            feedbackList().catch(()=>({ feedback:[] })),
            usersList().catch(()=>({ users:[] })),
            sessionsSummary().catch(()=>({ total:0, today:0, active:0, uniqueUsers:0 })),
            sessionsList({ page:1, pageSize:5 }).catch(()=>({ items:[] })),
          ])
          setMetrics({
            registrations: (r.registrations||[]).length,
            bookings: (b.bookings||[]).length,
            tools: (t.tools||[]).length,
            feedback: (f.feedback||[]).length,
            users: (u.users||[]).length,
            sessions: summ,
          })
          setRecentUsers((u.users||[]).slice(0,5).map(x=>({ ...x, role:(x.role||'').charAt(0).toUpperCase()+(x.role||'').slice(1) })))
          setRecentSessions(slist.items||[])
          setData([])
        } else if (tab==='Registrations') {
          const { registrations } = await registrationsList(); setData(registrations)
        } else if (tab==='Bookings') {
          const { bookings } = await bookingsList(); setData(bookings)
        } else if (tab==='Tools') {
          const { tools } = await toolsList(); setData(tools)
        } else if (tab==='Feedback') {
          const { feedback } = await feedbackList(); setData(feedback)
        } else if (tab==='Users') {
          try {
            const { users } = await usersList();
            // Normalize role capitalization for display
            setData(users.map(u => ({ ...u, role: (u.role||'').charAt(0).toUpperCase() + (u.role||'').slice(1) })))
          } catch (e) {
            setErr(e.message)
            setData([])
          }
        }
        setPage(1)
        setSearch('')
      } catch (e) { setErr(e.message); setData([]) }
    })()
  }, [tab])

  const filtered = useMemo(() => {
    if (!search) return data
    const q = search.toLowerCase()
    return data.filter(row => Object.values(row).some(v => String(v).toLowerCase().includes(q)))
  }, [data, search])

  const paged = useMemo(() => {
    const start = (page-1)*pageSize
    return filtered.slice(start, start+pageSize)
  }, [filtered, page])

  const totalPages = Math.max(1, Math.ceil(filtered.length / pageSize))

  return (
    <div>
      <Breadcrumbs items={[{label:'Admin Panel', to:'/admin'}, {label: tab}]} />
      <div className="page-header">
        <h2>Admin Panel</h2>
        <div className="actions">
          {tab==='Users' && <Link className="btn" to="/users">Open User Management</Link>}
        </div>
      </div>
      <div className="card" style={{ marginTop: 8 }}>
        <TabBar tab={tab} setTab={setTab} />
      </div>

      {err && <p className="error">{err}</p>}

      {/* Dashboard cards */}
      {tab==='Dashboard' && (
        <>
          <h3 style={{ marginTop:16 }}>Dashboard</h3>
          <div className="grid-4" style={{ marginTop:12 }}>
            <div className="metric-card"><div className="metric-label">Total Sessions</div><div className="metric-value">{metrics.sessions.total||0}</div></div>
            <div className="metric-card"><div className="metric-label">Today's Sessions</div><div className="metric-value">{metrics.sessions.today||0}</div></div>
            <div className="metric-card"><div className="metric-label">Active Sessions</div><div className="metric-value">{metrics.sessions.active||0}</div></div>
            <div className="metric-card"><div className="metric-label">Unique Users</div><div className="metric-value">{metrics.sessions.uniqueUsers||0}</div></div>
          </div>

          <div className="grid-2" style={{ marginTop:16 }}>
            <div className="card">
              <h3 style={{ marginTop:0 }}>Recent Users</h3>
              <div className="table-wrap">
                <table className="table">
                  <thead><tr><th>Name</th><th>Email</th><th>Joined</th><th>Role</th></tr></thead>
                  <tbody>
                    {recentUsers.map(u => (
                      <tr key={u._id || u.id}>
                        <td>{u.name}</td>
                        <td>{u.email}</td>
                        <td>{u.createdAt ? new Date(u.createdAt).toLocaleString() : '-'}</td>
                        <td><span className={`badge ${String(u.role).toLowerCase()}`}>{u.role}</span></td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
            <div className="card">
              <h3 style={{ marginTop:0 }}>Recent Sessions</h3>
              <div className="table-wrap">
                <table className="table">
                  <thead><tr><th>User</th><th>Login Time</th><th>Status</th></tr></thead>
                  <tbody>
                    {recentSessions.map(s => (
                      <tr key={s._id}>
                        <td>{s.username}</td>
                        <td>{new Date(s.loginAt).toLocaleString()}</td>
                        <td><span className={`chip ${s.status==='Active'?'chip-success':'chip-muted'}`}>{s.status}</span></td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          </div>
        </>
      )}

      {tab!=='Dashboard' && (
        <>
          <div className="card" style={{ marginTop: 12 }}>
            <div className="row" style={{ display:'flex', gap:8 }}>
              <div style={{ flex:1, display:'flex', alignItems:'center', gap:8 }}>
                <IconSearch />
                <input placeholder={`Search ${tab}...`} value={search} onChange={e=>{setSearch(e.target.value); setPage(1)}} />
              </div>
              <button className="btn ghost" onClick={()=>{setSearch(''); setPage(1)}}><IconRefresh /> Clear</button>
            </div>
            {filtered.length === 0 ? (
              <p className="hint">No data</p>
            ) : (
              <div className="table-wrap">
                <table className="table">
                  <thead>
                    <tr>
                      {tab==='Users' ? (
                        <>
                          <th>Name</th>
                          <th>Email</th>
                          <th>Role</th>
                          <th>Joined</th>
                        </>
                      ) : (
                        Object.keys(filtered[0]).filter(k=>k!=='password' && k!=='__v').slice(0,6).map(k=> <th key={k}>{k}</th>)
                      )}
                    </tr>
                  </thead>
                  <tbody>
                    {tab==='Users' ? (
                      paged.map(u => (
                        <tr key={u._id || u.id}>
                          <td>{u.name}</td>
                          <td>{u.email}</td>
                          <td><span className={`badge ${String(u.role).toLowerCase()}`}>{u.role}</span></td>
                          <td>{u.createdAt ? new Date(u.createdAt).toLocaleString() : '-'}</td>
                        </tr>
                      ))
                    ) : (
                      paged.map((row,i)=> (
                        <tr key={row._id || i}>
                          {Object.keys(row).filter(k=>k!=='password' && k!=='__v').slice(0,6).map(k=> <td key={k}>{String(row[k])}</td>)}
                        </tr>
                      ))
                    )}
                  </tbody>
                </table>
              </div>
            )}
            <div className="pagination">
              <button className="btn ghost" onClick={()=>setPage(p=>Math.max(1,p-1))}>Prev</button>
              <span className="hint">Page {page} of {totalPages}</span>
              <button className="btn ghost" onClick={()=>setPage(p=>Math.min(totalPages,p+1))}>Next</button>
            </div>
          </div>
        </>
      )}
    </div>
  )
}
